import React from 'react';
import { styled } from 'styled-components';

function Orb() {


    const OrbStyled = styled.div`
    
    width: 70h;
    height: 70h;
    position: absolute;
    border-radius: 50%;
    margin-left: -37vh;
    margin-top: 37vh;
    background: linear-gradient(180deg, #F56692 0%, #F2994A 100%);
    filter: blur(100px);
`;


    return <OrbStyled>

    </OrbStyled>;
};


export default Orb
